import { ReactDOM } from "react";
import { BrowserRouter } from "react-router-dom";

import "./index.css";
import App from "./App";
import { AuthContextProvider } from "./store/auth-context";

const root = Rea.createRoot(document.getElementById("root"));
root.render(
  <AuthContextProvider>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </AuthContextProvider>,
  { root }
);
// very important Authentication
// Its very important tu authenticate user.
// content should not pe provided to all user so thats we have to Authenticate
